import React from 'react';

function Header() {
  return (

    <header id="header" className="fixed-top d-flex align-items-center header-transparent">
      <div className="container d-flex align-items-center">

        <div className="logo mr-auto">
          <h1 className="text-light"><a href="index.html"><span>Vidyardi</span></a></h1>
        </div>

        <nav className="nav-menu d-none d-lg-block">
          <ul>
            <li className="active"><a href="index.html">Home</a></li>
            <li><a href="#about">Coading for Kids</a></li>
            <li><a href="#features">Buy a Course</a></li>
            <li><a href="#gallery">Study Material</a></li>
            <li><a href="#team">My Classes</a></li>
            <li><a href="#pricing">Others</a></li>
          </ul>
        </nav>
        </div>
      </header>
  );
};

export default Header;
